export function ProgrammerInfoPage(params)  {
  const {curPage, setCurPage, curPage2, setCurPage2} = useContext(curPageContext);
  const [sNo, setSNo] = useState(""); const [vNo, setVNo] = useState("");
  const [mDate, setMDate] = useState("");
  

